/* Base */
import { useState } from 'react'
import { useNavigate, Link } from 'react-router-dom'
import axios from 'axios'

/* Authentication Context */
import { useAuthContext } from '../../hooks/useAuthContext'
import { doLogin } from '../../contexts/AuthContext'

/* Bootstrap */
import { Button, Form, InputGroup } from 'react-bootstrap'
import Card from 'react-bootstrap/Card';
import Container from 'react-bootstrap/Container';

/* Styling */
import './Signup.css'


export default function Signup() {

    /* Declaring State Object and Constant variables */
    const [email, setEmail] = useState<string>("")
    const [username, setUsername] = useState<string>("")
    const [password, setPassword] = useState<string>("")
    const [emailError, setEmailError] = useState<string | null>(null)
    const [usernameError, setUsernameError] = useState<string | null>(null)
    const [passwordError, setPasswordError] = useState<string | null>(null)
    const [generalError, setGeneralError] = useState<string | null>(null)

    const { dispatch } = useAuthContext()

    const url = 'http://localhost:8000/user/signup'

    const navigate = useNavigate()


    /* Declaring Event handler */
    const handleSubmit = (e: React.FormEvent<HTMLFormElement>) => {

        e.preventDefault()
        
        axios.post(url, {email, username, password})
            .then((res) => {

                console.log('Login successful!')
                console.log('Response:', res)

                dispatch(doLogin(username))
                sessionStorage.setItem("sessionName", username)
                navigate('/')

            })
            .catch((err) => {
                if (err.response) {
                    /* The request was made and the server responded with a status code that falls out of the range of 2xx */
                    console.log(err.response.data.error)
                    setEmailError(err.response.data.error.email)
                    setUsernameError(err.response.data.error.username)
                    setPasswordError(err.response.data.error.password)

                } else if (err.request) {
                    /* The request was made but no response was received */
                    console.log(err.request)
                    setGeneralError(err.request)

                } else {
                    /* Something happened in setting up the request that triggered an Error */
                    console.log(err.message)
                    setGeneralError(err.message)
                }
                console.log(err.config)
            });
    }

    /* Render */
    return (
        <Container fluid className="signup_page">
            { generalError && <p className="error"> {generalError}</p> }
            { emailError && <p className="error">Email: {emailError}</p> }
            { usernameError && <p className="error">Username: {usernameError}</p> }
            { passwordError && <p className="error">Password: {passwordError}</p> }
            <Card className="form_card">
                <Card.Body>
                    <Card.Title className="form_title">Create an account</Card.Title>
                    <Form className="signup_form" onSubmit={handleSubmit}>
                        <Form.Label className="form_label">Email:</Form.Label>
                        <InputGroup className="form_input">
                            <InputGroup.Text>@</InputGroup.Text>
                            <Form.Control 
                                type="email" 
                                placeholder='Enter email'
                                onChange={(e) => setEmail(e.target.value)}
                                value={email}
                            />
                        </InputGroup>

                        <Form.Label className="form_label">Username:</Form.Label>
                        <InputGroup className="form_input">
                            <InputGroup.Text>@</InputGroup.Text>
                            <Form.Control 
                                type="text" 
                                placeholder='Enter username'
                                onChange={(e) => setUsername(e.target.value)}
                                value={username}
                            />
                        </InputGroup>

                        <Form.Label className="form_label">Password:</Form.Label>
                        <InputGroup className="form_input">
                            <InputGroup.Text>@</InputGroup.Text>
                            <Form.Control 
                                type="password" 
                                placeholder='Enter password'
                                onChange={(e) => setPassword(e.target.value)}
                                value={password}
                            />

                        </InputGroup>
                                                        
                        <Button className="submit_button" variant='primary' type="submit">Sign up</Button>

                        

                    </Form> 
                </Card.Body>
                <Card.Footer className="card_footer"> Already have an account? {<Link to="/login">Login</Link>} </Card.Footer>
            </Card>

        </Container>        
    )
}
